import React, {Component} from 'react';

class Reacdemo extends Component{
    
    myElement(){
         var container= document.getElementById('MyEle');
         var MyElem= <h2>This is container and elenent it's render ReactDOMe.</h2>
    }
    
    render(){
        return <div>
            <button onClick={this.myElement}>button</button>
            <h2 id="MyEle">cheng</h2>
        </div>
        
    }
}

export default Reacdemo;
